    false,nt"url": null,nt"notes": "The Infrastructure Condition Evaluation
    (ICE) is the combination of seven individual criteria that were merged through a
    linear overlay process, which allows for the evaluation of the entire interstate
    mainline system using a single composite rating. The seven criteria are: PCI, SIA
    Sufficiency Rating, IRI, Combination Truck AADT, Single Unit Truck AADT, Passenger
    AADT, and Congestion (V/C). Generally, the higher the composite score, the better
    condition the interstate segment is in. This evaluation was the basis for development
    of the Interstate Corridor Plan. For more information visit: http://www.iowadot.gov/systems_planning/pr_guide/InterstateCorridorPlan.pdf",nt"license_title":
